import Button from '../../pages/login/Button';
import './index.css';
import { useState} from "react";

import Api from '../../services/api';

export default function SignIn() {

  const [ email, setEmail ] = useState('');
  const [ senha, setSenha ] = useState('');
 

  async function handleSubmit(){

    try {
      await Api.post('signInDoctor',{email,senha})
    .then(res => {
        if(res.status===200){
            if(res.data.status===1){
                window.location.href= '/painel'
            }else if(res.data.status===2){
                alert('Atenção: '+res.data.error);
            }
            
        }else{
            alert('falhas');
            
        }
    });
    } catch (error) {
      alert('Erro no servidor');
    }
    
}


    return (
      <div>
        <div><a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className = {'logo'} title="source: imgur.com" /></a></div>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <form className={'form'}>
        <text>Faça seu login</text>
          <br></br>
          <br></br>
          <br></br>
          <label>
            E-mail:
            <input type="text" name="Email" />
          </label>
          <label>
            Senha:
            <input type="password" name="Email" />
          </label>
          <br></br>
            <Button onClick={handleSubmit}>
              Entrar
            </Button>
            <br></br>
            <br></br>
            <label1>Esqueci a senha</label1>
            <label2>Cadastrar-se</label2>
         </form>
        
      </div>
  );
    }
